import React, { useContext } from "react";
import { useParams } from "react-router-dom";
import HomePage from "../WebsitePages/HomePage";
import { GlobalContext } from "../context/Provider";
import SubPage from "../WebsitePages/ SubPage";
import _ from "lodash";

interface WebsiteGeneratorProps {}

const WebsiteGenerator = ({}: WebsiteGeneratorProps) => {
  const globalStore: any = useContext(GlobalContext);
  const { pageId } = useParams();
  const Index = _.findIndex(globalStore.webData, {
    pageId: globalStore.contentId,
  });

  return pageId === "0" ? (
    <HomePage content={globalStore.webData[Index]} />
  ) : (
    parseInt(pageId!) > 0 && <SubPage content={globalStore.webData[Index!]} />
  );
};

export default WebsiteGenerator;
